 (693,6412,37,1,1,1,0,'2017-10-01','2020-06-30','2017-11-01',2242500,0,0,0,0,'■オーナーの費用負担について\r\n設備の不良が原因のトラブル：可能\r\nオーナー契約者が原因のトラブル（入庫車室ミスなど）：不可\r\n\r\n現地管理人室\r\n03-3779-4877\r\n080-1192-5389\r\n',149,'2019-05-10 14:38:01',178,'2017-09-15 11:08:31',0,0,0,0,'','',0,'{\"renewal_fee\": \"5000\", \"key_reissue_fee\": \"5000\", \"card_reissue_fee\": \"20000\", \"remote_controller_reissue_fee\": \"20000\", \"storage_document_issuance_fee\": \"10000\"}',NULL,NULL),
 (694,154275,410,1,1,1,0,'2017-09-25','2020-06-30','2017-09-25',550000,0,0,0,0,'■出来形区画の動作について\r\n出来高区画16が契約者への引き渡しの際に正しく動作せず、そのまま解約となった経緯あり。\r\n（点検を行っても特に問題は発見できなかった）出来形区画のリーシングを行う際は要注意。\r\n\r\n■車室番号について\r\n地下2階：1番から37番（偶数番号が上段（出来形）\r\n地下3階：38番から74番　（奇数番号が上段（出来形）',74,'2019-05-16 17:16:22',178,'2017-09-15 11:46:29',0,63,0,3,'■新規契約者に対しての声がけ\r\n新規契約者に対しては駐車の際の注意点として「柱には区画番号が明記されており、その柱の一部が地下2階ではピンク色、地下3階では青色である事」を必ず伝える。\r\n\r\n■トラブル時の対応について（PMからの文章）\r\n①駐車場の操作に関する不具合は直ちに防災センターに連絡いただくこと。連絡は基本的には貴社経由でお願いしますが、機械が操作できないなど緊急を要する場合は防災センターに直接連絡いただくことでも構いません。\r\n②各区画には契約車両以外は駐車しないこと。また、駐車車両を変更する場合は直ちに届け出をしてもらうこと。','',0,'{\"renewal_fee\": \"5000\", \"key_reissue_fee\": \"5000\", \"card_reissue_fee\": \"20000\", \"remote_controller_reissue_fee\": \"20000\", \"storage_document_issuance_fee\": \"10000\"}',NULL,NULL),
