 (1028,1053562,94,1,1,1,0,'2018-03-01','2020-06-30','2018-11-01',441000,NULL,NULL,NULL,NULL,'■訳有り物件の為に要注意\r\n①通行許可証が必要になります。\r\n　２２時ー２５時に前面道路を利用する際は通行許可証が必要になります。\r\n　契約者自身で申請が必要なので、事前に説明してください。\r\n　取得までの流れをまとめたものを添付します。\r\n　（添付の申請書も必要です）\r\n　\r\n②上記に伴い、直営契約書も変更になります。\r\n　特約に追記しておりますので、添付の雛形をお使いください。\r\n\r\n③隣接物件の工事影響\r\n　現在、隣で建設工事が行われております。（ヒューリック）\r\n　工事の影響で６月末まで時間制限がありますので、ご注意ください。\r\n　（２０時～翌朝６時まで通行禁止）\r\n　７月から２４時間利用ができますので、こちらも予め説明してください。\r\n\r\n　工事の影響でフリーレント期間は１０月末までありますので、\r\n　早期で満車稼働を狙って、収益化してください。',145,'2019-06-17 16:44:37',178,'2018-01-09 11:24:22',0,98,98,1,'','',0,'{\"renewal_fee\": \"5000\", \"key_reissue_fee\": \"5000\", \"card_reissue_fee\": \"20000\", \"remote_controller_reissue_fee\": \"20000\", \"storage_document_issuance_fee\": \"10000\"}','{\"1\": \"本物件の前面道路を全日夜間22時～２５時の時間帯に利用するにあたり、通行証許可証が必要になり、乙は自らの責任と負担において通行証許可証を取得するものとする。\"}',NULL),
