 (1093,1020936,500,1,1,3,0,'2018-04-01','2020-06-30','2018-06-30',62000,NULL,NULL,NULL,NULL,'',118,'2018-09-18 13:36:54',178,'2018-03-19 11:20:55',0,98,98,1,'■入出庫操作時の注意点【重要】\r\n操作盤が2つありますが、1つずつしか作動できないものになります。\r\n2つ作動させてしまうと、動いているものが途中でとまってしまい全部ストップしてしまいます。\r\n復旧が簡単にできないので、契約者様には1つが作業中の場合は少し待っていただくよう必ず説明を行うように。\r\n\r\n■車の入出庫について（PMからの問合せ内容）\r\nお住まいの人がターンテーブルで動きを変えて出す時に、車をスロープの上まで入れて待たれてしまい出られなかったため、道路の方に移動してもらうようお願いしたそうですがとても嫌な態度を取られたとのことです。\r\n出入り口が１つしかないため、今後は出庫中の時は必ず道路で待機していただくようにしてください。','',0,'{\"renewal_fee\": \"5000\", \"key_reissue_fee\": \"5000\", \"card_reissue_fee\": \"20000\", \"remote_controller_reissue_fee\": \"20000\", \"storage_document_issuance_fee\": \"10000\"}',NULL,NULL),
