 (1179,1025259,170,1,4,1,0,'2018-08-01','2020-06-30','2018-12-01',1348000,NULL,NULL,NULL,NULL,'第２５条　（借地借家法）\r\n甲および乙は、乙の使用する駐車区画が明白に区画された独立性や排他的支配の可能性を備えた建物であるとはいえないことも踏まえ、本契約に基づく賃貸借に借地借家法の適用がないことを確認する。\r\n第２６条　（駐車場の使用制限）\r\n１．	甲が駐車場の保守・管理・運営上必要と認めた場合、甲は乙に対し本駐車場の使用を禁止し、又は使用時間帯の制限をすることができる。\r\n２．	本建物の全館休館及び甲が本建物の保守・管理・運営上必要と認めた場合、甲は乙に対し本駐車場の使用を禁止し、又は使用時間帯の制限をすることができる。\r\n３．	第１項及び第２項により甲が乙の本駐車場の使用を制限しようとする場合、甲は乙に対し事前にその内容を通知する。但し、緊急の場合はこの限りではない。\r\n第２７条　（禁止事項の追加）\r\n第7条の禁止事項として以下の第１４号及び第１５号を追加する。\r\n「⑭本駐車場内で出火危険を伴う自動車の整備、修理及び給油等を行うこと。\r\n⑮他の本建物利用者の迷惑となる行為、その他本建物に損害を及ぼす一切の行為をすること。」\r\n第２８条　（賠償義務）\r\n乙は、乙が第７条の定めに反して損害が発生した場合には、甲、本件所有者（第３１条において定義する。以下同じ。）又は丙（第３１条において定義する。以下同じ。）に対し賠償その他一切の請求をすることはできない。\r\n第２９条　（保証金返還債務の債務引受）\r\n乙は、第１３条に基づき賃貸人が変更する場合、新たな賃貸人が乙から保証金の引渡しを受けることを条件として、保証金返還債務を免責的に引き受けることに同意する。\r\n第３０条　（館内規則等）\r\n乙は、本件所有者が館内規則及び注意事項を定めて甲に対し通知した場合には、新たな館内規則及び注意事項を遵守するものとする。\r\n第３１条　（信託条項）\r\n甲及び乙は、本駐車場の所有者がみずほ信託銀行（以下「本件所有者」という。）であり、本契約は、ユナイテッド・アーバン投資法人（以下「丙」という。）と本件所有者との間のマスターリース契約に基づいて本駐車場の一括賃借を受ける丙が、甲と丙の間の駐車場賃貸借契約書に基づいて甲に転貸し、乙に転々貸する契約である（ただし、甲は、本件所有者及び丙の代理人として本契約を締結するものではない。）ことを確認する。敷金の返還債務を含む本契約上の賃貸人としての債務は、すべて甲が本契約に定めるところに従って乙に対し履行するものとする。乙は、本件所有者、丙、その他の第三者が、乙に対する敷金返還債務を含む本契約上のいかなる債務も負担しないことを承諾する。\r\n第３２条　（本建物）\r\n本契約において、本建物とは、契約要項の所在地に存する契約要項の名称に記載するビルを意味するものとする。',85,'2019-07-05 16:12:54',118,'2018-07-24 10:26:36',85,85,85,1,'','',0,'{\"renewal_fee\": \"5000\", \"key_reissue_fee\": \"5000\", \"card_reissue_fee\": \"20000\", \"remote_controller_reissue_fee\": \"20000\", \"storage_document_issuance_fee\": \"15000\"}',NULL,'{\"1\": {\"terms\": [\"甲および乙は、乙の使用する駐車区画が明白に区画された独立性や排他的支配の可能性を備えた建物であるとはいえないことも踏まえ、本契約に基づく賃貸借に借地借家法の適用がないことを確認する。\"], \"title\": \"借地借家法\"}, \"2\": {\"terms\": [\"甲が駐車場の保守・管理・運営上必要と認めた場合、甲は乙に対し本駐車場の使用を禁止し、又は使用時間帯の制限をすることができる。\", \"本建物の全館休館及び甲が本建物の保守・管理・運営上必要と認めた場合、甲は乙に対し本駐車場の使用を禁止し、又は使用時間帯の制限をすることができる。\", \"第１項及び第２項により甲が乙の本駐車場の使用を制限しようとする場合、甲は乙に対し事前にその内容を通知する。但し、緊急の場合はこの限りではない。\"], \"title\": \"駐車場の使用制限\"}, \"3\": {\"terms\": [\"第7条の禁止事項として以下の第１４号及び第１５号を追加する。\\r\\n「⑭本駐車場内で出火危険を伴う自動車の整備、修理及び給油等を行うこと。\\r\\n⑮他の本建物利用者の迷惑となる行為、その他本建物に損害を及ぼす一切の行為をすること。」\"], \"title\": \"禁止事項の追加\"}, \"4\": {\"terms\": [\"乙は、乙が第７条の定めに反して損害が発生した場合には、甲、本件所有者（第３１条において定義する。以下同じ。）又は丙（第３１条において定義する。以下同じ。）に対し賠償その他一切の請求をすることはできない。\"], \"title\": \"賠償義務\"}, \"5\": {\"terms\": [\"乙は、第１３条に基づき賃貸人が変更する場合、新たな賃貸人が乙から保証金の引渡しを受けることを条件として、保証金返還債務を免責的に引き受けることに同意する。\"], \"title\": \"保証金返還債務の債務引受\"}, \"6\": {\"terms\": [\"乙は、本件所有者が館内規則及び注意事項を定めて甲に対し通知した場合には、新たな館内規則及び注意事項を遵守するものとする。\"], \"title\": \"館内規則等\"}, \"7\": {\"terms\": [\"甲及び乙は、本駐車場の所有者がみずほ信託銀行（以下「本件所有者」という。）であり、本契約は、ユナイテッド・アーバン投資法人（以下「丙」という。）と本件所有者との間のマスターリース契約に基づいて本駐車場の一括賃借を受ける丙が、甲と丙の間の駐車場賃貸借契約書に基づいて甲に転貸し、乙に転々貸する契約である（ただし、甲は、本件所有者及び丙の代理人として本契約を締結するものではない。）ことを確認する。敷金の返還債務を含む本契約上の賃貸人としての債務は、すべて甲が本契約に定めるところに従って乙に対し履行するものとする。乙は、本件所有者、丙、その他の第三者が、乙に対する敷金返還債務を含む本契約上のいかなる債務も負担しないことを承諾する。\"], \"title\": \"信託条項\"}, \"8\": {\"terms\": [\"本契約において、本建物とは、契約要項の所在地に存する契約要項の名称に記載するビルを意味するものとする。\"], \"title\": \"本建物\"}}'),
