 (1389,1088751,691,0,1,1,86,'2019-04-01','2019-03-31','2019-05-01',0,NULL,NULL,NULL,NULL,'■ML契約について\r\n賃料保証区画と出来高（パススルー）区画の2タイプがある。\r\n・共通：2019年10月から消費税10％での賃料支払いを行う。\r\n・出来高（パススルー）区画：承継なし、当月賃料を当月末に支払う。\r\n・出来高（パススルー）区画のオーナーへの支払い賃料：転貸賃料（税別）合計額から、稼働車室数【転貸中の車室数】に3000円（税別）乗じた金額を差し引いた金額\r\n\r\n\r\n＜パススルーMTG＞\r\n●物件\r\n■ヴィクトリア本店\r\n■スーパースポーツゼビオ東京御茶ノ水本店\r\nオーナー側から紹介がない限り発生しなそうな案件（スタート既存あり）\r\n\r\n【概要】\r\n保証賃料\r\n＝転貸賃料（税別）の合計額から稼働車室数（転貸中の車室数）に3000円（税別）を乗じた金額を差し引いた金額\r\n＝出口賃料―3,000円\r\n●28,000円（募集賃料）\r\n●25,000円（下限）\r\n\r\n・パターン①→1～15日開始　一律3000円（税別）/台　3,000円もらえる\r\n・パターン②→16～末日開始　一律0円（税別）/台　　3,000円もらえない　\r\nオーナーの雛形で契約者一覧を作成（フォーマットを江口とオーナーで相談）\r\n\r\n転貸賃料＝オーナー側の要望（固定？）\r\n※出口（募集）賃料確認（江口）\r\n※未納でもオーナーへ支払い必要\r\nシステム上管理表を分ける（完全保証・パススルー）\r\n（※CS側）\r\n\r\n■スケジュール確認\r\n・CS側（リスト作成）（ユーザー名と金額（マンスリー））\r\n　↓報告（毎月20日）\r\n・管理部側\r\n　↓オーナーへ報告（毎月25日くらい？）※オーナーへ「日付」と「担当者」確認中（江口）\r\n・支払い（毎月末前日）',149,'2019-04-12 09:32:13',149,'2019-04-12 09:32:13',0,239,0,2,'シャッターに関して\r\n7：00～22：00【月・火・水・木・金】のお時間は開放致します。\r\n※それ以外の時間は引き続き閉鎖になります。\r\n※7：00に開放。22：00に閉鎖する設定で自動で開きますが、\r\n　手動で開閉すると、自動で閉まらずその状態が維持されますのでご注意お願いいたします。','',0,'{\"renewal_fee\": \"5000\", \"key_reissue_fee\": \"5000\", \"card_reissue_fee\": \"20000\", \"remote_controller_reissue_fee\": \"20000\", \"storage_document_issuance_fee\": \"10000\"}',NULL,NULL),
