 (1442,1084485,174,1,1,1,0,'2019-06-01','2024-05-31','2019-06-01',0,NULL,NULL,NULL,NULL,'・契約期間5年、以後3年ごとの自動更新\r\n・特約：フリーレントを設定しない代わりに段階賃料としました。\r\n・中途解約に違約設定\r\n●2019年6月1日～2022年5月31日（当初３年間は）\r\n　金2,052,000円（消費税等別途）/月（54台→1台あたり：38,000円（消費税等別途））\r\n●2022年6月１日以降\r\n　金2,310,000円（消費税等別途）/月（54台→1台あたり：42,777円（消費税等別途））\r\n\r\n第２５条[特約事項]\r\n1.	\r\n本契約要項記載の月額賃料は、本契約期間中の２０１９年６月１日から２０２２年５月３１日の当初３年間は金２，０５２，０００円（消費税等別途）とする。\r\n2.	\r\n本契約第６条に基づき車室を返還する際には、本契約要項記載の月額賃料から１台あたり月額金４２，７７７円（消費税等別途）を減額するものとする。\r\nただし、前項の期間中においては、１台あたり月額金３８，０００円（消費税等別途）を減額する。\r\n3.	\r\n本条第１項の期間中において本契約第６条に基づき車室を返還する場合、甲は乙に対して次の算定式で計算した額を返還のあった日の翌月末までに支払うものとする。\r\n算定式（１台あたり）\r\n金（42,777-38,000）円（消費税等別途）相当額×（36ヶ月－契約経過月数（※１））\r\n※１：月の途中で解約する場合、その月は契約経過月数に算入しない。\r\n4.	\r\n甲及び乙は本契約期間中の２０１９年６月１日から２０２４年５月３１日の５年間においては、中途解約を申し出ることができない。ただし、相手方に解約時点の月額賃料３ヶ月分（消費税等を含む）相当額を違約金として支払うことにより、解約することができるものとする。\r\n',74,'2019-05-23 15:48:34',74,'2019-05-23 15:48:34',174,174,174,1,'','',0,'{\"renewal_fee\": \"5000\", \"key_reissue_fee\": \"5000\", \"card_reissue_fee\": \"20000\", \"remote_controller_reissue_fee\": \"20000\", \"storage_document_issuance_fee\": \"10000\"}',NULL,NULL),
